import "./Expenseltem.css";

function Expenseltem() {
  return (
    <>
      <div className='expense-item'>
        <div>March 28th 2021</div>
        <div className='expense-item__description'>
          <h2>Car Insuranse</h2>
          <div className="ex">$294.67</div>
        </div>
      </div>
    </>
  );
}

export default Expenseltem;
